complete_model_interaction.output:
Step 1: The key psychological mechanism is that responders do not solely value the monetary amount they receive; they also experience disutility when the offer is perceived as unfair. In standard Fehr–Schmidt models, this is captured using an inequality aversion parameter. Here, instead of relying on a fixed fairness norm, we assume responders form and update an expectation of what a fair split should be (their “expected share”), based on past offers. Thus, if the monetary offer falls below their dynamically learned expectation (based on the combined available earnings), they experience disutility. 

Step 2: The mechanisms interact as follows. At each trial the responder has an evolving fairness expectation (f_t), which starts at 0.5 and is then updated based on the actual proportion of the combined earnings allocated to them (split_self/combined_earning). The utility of accepting an offer is given by the monetary payout (split_self) minus a penalty that is proportional to how far below their expectation the offer is (if at all). The penalty is scaled by a fairness sensitivity parameter (alpha). Only when the actual offer is less than the fair expectation (i.e. when f_t*combined_earning > split_self) is there a penalty.

Step 3: The mathematical form derived to capture these interactions is:
• Utility for accepting at trial t: U_t = split_self_t - alpha * max( f_t * combined_earning_t - split_self_t, 0)
• Learning rule for updating the fairness expectation: f_{t+1} = f_t + learning_rate * (split_self_t / combined_earning_t - f_t)
Here, the two learnable parameters are:
• alpha – a sensitivity to deviations from the expected fair share.
• learning_rate – governing how rapidly the fairness expectation adjusts based on the observed split.

Step 4: The two parameters are sufficient:
• alpha: with finite bounds, for instance in [0, 10].
• learning_rate: with bounds [0, 1].
The state variable f_t evolves between 0 and 1.

Step 5: In our formulation, each trial’s observed variables (split_self and combined_earning) from the dataset are used to compute the experienced utility. The utility function thus derived is used to explain the probability of accepting an offer (with negative utilities making acceptance unlikely), while rejection utility need not be modeled here.

The formal model specification is given below.

<MODEL>
U_t = split_self_t - alpha * max(f_t * combined_earning_t - split_self_t, 0)
f_t+1 = f_t + learning_rate * ((split_self_t / combined_earning_t) - f_t)
</MODEL>

